export default function Todo({ todo, onDeleteBtnClick }) {
   return (
      <div key={todo.id}>
         <p>
            {todo.title}
            <input type="checkbox" checked={todo.completed} />
            <button onClick={onDeleteBtnClick}>Delete todos</button>
         </p>
      </div>
   );
}
